using MediatR;
using Serilog;
using Notary.SSAA.BO.CommandHandler.Base;
using Notary.SSAA.BO.DataTransferObject.Commands.Fingerprint;
using Notary.SSAA.BO.DataTransferObject.Mappers.Fingerprint;
using Notary.SSAA.BO.DataTransferObject.Queries.Fingerprint;
using Notary.SSAA.BO.Domain.Abstractions;
using Notary.SSAA.BO.Domain.Abstractions.Base;
using Notary.SSAA.BO.Domain.Entities;
using Notary.SSAA.BO.Domain.RepositoryObjects.Fingerprint;
using Notary.SSAA.BO.SharedKernel.Constants;
using Notary.SSAA.BO.SharedKernel.Interfaces;
using Notary.SSAA.BO.SharedKernel.Result;
using Notary.SSAA.BO.Utilities.Extensions;
using System.Runtime.CompilerServices;
using Microsoft.EntityFrameworkCore;

namespace Notary.SSAA.BO.CommandHandler.Fingerprint_V2.Handlers
{
    internal class CreateFakePersonFingerprintCommandHandler : BaseCommandHandler<CreateFakePersonFingerprintCommand, ApiResult>
    {
        private Domain.Entities.PersonFingerprint masterEntity;
        private readonly IPersonFingerprintRepository _personFingerprintRepository;
        private ApiResult apiResult;
        private readonly IDateTimeService _dateTimeService;
        private readonly IRepository<SignRequestPerson> _signRequestPersonRepository;
        private readonly IRepository<DocumentPerson> _documentPersonRepository;
        public CreateFakePersonFingerprintCommandHandler(IMediator mediator, IDateTimeService dateTimeService, IPersonFingerprintRepository personFingerprintRepository,
            IUserService userService, ILogger logger, IRepository<SignRequestPerson> signRequestPersonRepository, IRepository<DocumentPerson> documentPersonRepository) : base(mediator, userService, logger)
        {
            _personFingerprintRepository = personFingerprintRepository ?? throw new ArgumentNullException(nameof(personFingerprintRepository));
            apiResult = new ApiResult<GetInquiryPersonFingerprintRepositoryObject>();
            _dateTimeService = dateTimeService ?? throw new ArgumentNullException(nameof(dateTimeService));
            _signRequestPersonRepository = signRequestPersonRepository;
            _documentPersonRepository = documentPersonRepository;
        }

        protected override async Task<ApiResult> ExecuteAsync(CreateFakePersonFingerprintCommand request, CancellationToken cancellationToken)
        {
            if (string.IsNullOrWhiteSpace(request.PersonNationalNo) || string.IsNullOrWhiteSpace(request.DocumentRequestNo))
            {
                apiResult.IsSuccess = false;
                apiResult.message.Add("کد ملی شخص و شماره سند مرتبط اجیاری می باشند");
                return apiResult;
            }
            var person = await _documentPersonRepository
                              .TableNoTracking
                              .Include(x=>x.Document)
                              .Where(x => x.NationalNo == request.PersonNationalNo && x.Document.RequestNo == request.DocumentRequestNo)
                              .FirstOrDefaultAsync(cancellationToken);
            if (person != null)
            {
                if (person.Document.IsRemoteRequest == "1")
                {
                    //GetInquiryPersonFingerprintRepositoryObject viewModel = new();
                    GetInquiryPersonFingerprintQuery inquiryFingerprintQuery = new(person.DocumentId.ToString(), request.PersonNationalNo);
                    var inquiry = await _mediator.Send(inquiryFingerprintQuery, cancellationToken);
                    string icon = "";

                    if (inquiry.IsSuccess)
                    {
                        var fingerprint = await this._personFingerprintRepository.GetByIdAsync(cancellationToken, inquiry.Data.FingerprintId.ToGuid());

                        fingerprint.IsRemoteRequest = "1";
                        fingerprint.UseCasePersonObjectId = person.Id.ToString();
                        fingerprint.PersonFingerprintUseCaseId = "2";
                        fingerprint.State = "1";
                        await _personFingerprintRepository.UpdateAsync(fingerprint, cancellationToken);

                        //viewModel = inquiry.Data;
                    }
                    else
                    {
                        masterEntity = new()
                        {
                            Id = Guid.NewGuid(),
                            TfaIsRequired="2",
                            IsDeleted = "2",
                            MocIsRequired = "2",
                            TfaState = "1",
                            Ilm = "1",
                            RecordDate = _dateTimeService.CurrentDateTime,
                            OrganizationId = _userService.UserApplicationContext.BranchAccess.BranchCode,
                            UseCaseMainObjectId = person.DocumentId.ToString(),
                            UseCasePersonObjectId = person.Id.ToString(),
                            PersonFingerprintUseCaseId = "2",
                            IsRemoteRequest = "1",
                            FingerprintFeatures = Convert.FromBase64String(icon),
                            FingerprintGetDate = _dateTimeService.CurrentPersianDate,
                            FingerprintGetTime = _dateTimeService.CurrentTime,
                            FingerprintImageFile = Convert.FromBase64String(icon),
                            FingerprintImageHeight = 100,
                            FingerprintImageWidth = 100,
                            FingerprintImageType = "JPEG",
                            FingerprintRawImage = Convert.FromBase64String(icon),
                            FingerprintScannerDeviceType = "-",
                            PersonFingerTypeId = "1",
                            PersonNationalNo = request.PersonNationalNo,
                            State = "1"
                        };
                        
                    }
                    
                }
                else
                {
                    apiResult.IsSuccess = false;
                    apiResult.message.Add(string.Format("سند مرتبط با شماره {0} به صورت غیر حضوری ثبت نشده است", request.DocumentRequestNo));
                }
            }
            else
            {
                apiResult.IsSuccess = false;
                apiResult.message.Add(string.Format("شخص با کد ملی {0} در سند شماره {1} یافت نشد", request.PersonNationalNo, request.DocumentRequestNo));
            }

           

            return apiResult;
        }

        protected override bool HasAccess(CreateFakePersonFingerprintCommand request, IList<string> userRoles)
        {
            return userRoles.Contains(RoleConstants.Sardaftar) || userRoles.Contains(RoleConstants.Daftaryar) || userRoles.Contains(RoleConstants.SanadNevis);
        }
    }
}
